Comércio eletrônico (português brasileiro) ou comércio eletrónico (português europeu), e-commerce, comércio virtual ou venda não-presencial (que se estende até venda por telemarketing), é um tipo de transação comercial (com ou sem fins lucrativos) feita especialmente através de um equipamento eletrônico, como, por exemplo, computadores, tablets e smartphones. A crescente informatização das mais diversas atividades transforma a tecnologia da informação (TI) em uma área cada vez mais relevante economicamente. A expansão levou à especialização e, atualmente, é possível encontrar várias sub-áreas de TI dedicadas a tarefas específicas – e que demandam profissionais com conhecimentos igualmente aprofundados. Seus fundamentos estão baseados em segurança, criptografia, moedas e pagamentos eletrônicos. Ele ainda envolve pesquisa, desenvolvimento, marketing, propaganda, negociação, vendas e suporte. É o segmento que cuida de todas as informações eletrônicas armazenadas por uma empresa. No caso de instituições financeiras, por exemplo, esses dados incluem nomes de clientes e até valores de transações monetárias efetuadas por grandes corporações. Comércio eletrónico compreende qualquer tipo de negócio/transacção comercial que implica a transferência de informação através da internet. Existem diferentes tipos de negócio que se estabelecem por e-commerce, B2B (Business to Business) ou B2C (Business to Consumer) que se dirige diretamente ao consumidor, este último está em franco crescimento nas diversas áreas de negócio bens e serviços, com a proliferação também da oferta de criação de lojas on-line. A criação de uma loja on-line está a a ser encarada pelas empresas não apenas como uma actualização, acompanhamento das novas tendências, mas também como uma área de negócio alternativa explorando as suas vantagens face aos métodos tradicionais. Quem inicia uma loja on-line deverá ter em consideração aspectos básicos, mas determinantes para o sucesso do negócio, nomeadamente: 
*  a definição clara do produto e/ou serviço e a sua disponibilidade imediata ou num prazo definido on-line, normalmente dirigido a um nicho bem definido; 
*  atenção os aspectos logísticos do negócio, muito importantes em determinado tipo de bens; 
*  as formas de pagamento disponíveis e os eventuais problemas de segurança que se colocam; 
*  uma estratégia de webmarketing clara que permita conduzir tráfego qualificado para a loja.
